import React from "react";
const ShowQuestions = (props) => {
  const questions = props.questions.map((question, index) => {
    return (
      <li key={index}>
        Title:{question.title}
        <br />
        Topic:{question.topic}
      </li>
    );
  });
  return <ul>{questions}</ul>;
};
export default ShowQuestions;
